import { useSelector } from "react-redux"
import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import { Dialog, DialogContent, DialogContentText, DialogTitle, IconButton } from "@mui/material";
import CloseIcon from '@mui/icons-material/Close';

export const DriveTypes = () => {

    let driveTypes = useSelector(x => x.DriveTypes)

    let nav = use

    //    DriveTypes: [{ id: 1, description: "דלק", pricePerLiter: 10 },

    return <>

        <Dialog open={true}
            id="DialogAddModel"
        >
            <DialogTitle id="closeDialog">
                <IconButton className="roundButton" onClick={() => nav("../")} ><CloseIcon /></IconButton>
                <DialogContentText id="carDetailes">הנעה סוגי: </DialogContentText>
            </DialogTitle>
            <DialogContent id="DialogModel">
                <TableContainer id="driveTypesTable" component={Paper} >
                    <Table sx={{ minWidth: 650 }} aria-label="simple table">
                        <TableHead>
                            <TableRow>
                                <TableCell align="right">סוג הנעה</TableCell>
                                <TableCell align="right">מחיר</TableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {driveTypes.map((t) => (
                                <TableRow
                                    key={t.description}
                                    sx={{ '&:last-child td, &:last-child th': { border: 0 } }} >
                                    <TableCell component="th" scope="row" align="right" id="rows"> {t.description} </TableCell>
                                    <TableCell align="right" id="rows">{t.pricePerLiter}</TableCell>
                                </TableRow>
                            ))}
                        </TableBody>
                    </Table>
                </TableContainer>
            </DialogContent>
        </Dialog>

    </>
}
